 import Table from "../../components/Table/Table";

import img6 from '../../assets/images/img6.png';
import img7 from '../../assets/images/img7.png';
import img8 from '../../assets/images/img8.png';
import img9 from '../../assets/images/img9.png';
import { Link} from 'react-router-dom';

import Descripcion from "../../components/Descripcion/Descripcion";


let lugar = [
    {
        texto: 'Las pruebas de Usabilidad se centraron en evaluar la experiencia, 치reas de oportunidad y buenas pr치cticas de la iniciativa de pago de servicios por la aplicaci칩n m칩vil de banco.',
        tiempo: 'Prueba de Usabilidad',        
    },
];

export default function Telefoniainfo() {
    return (
        <div>
            <div className="container my-3">
            <h1 className="titulo2">Telefon칤a M칩vil</h1>
                <div className="col-sm">
                    <div className="lugar">
                        {lugar.map((descripcion, index) => {
                            return (
                                <Descripcion
                                    key={index}                                                                      texto={descripcion.texto}
                                    tiempo={descripcion.tiempo}
                                    precio={descripcion.precio}
                                    costo={descripcion.costo}
                                >
                                </Descripcion>
                            );
                        })}
                    </div>                    
                </div>

               
                <div className="row my-3">
                    <p className="texto1">Los objetivos que se tomaron en cuenta al momento de realizar la recarga, fueron:</p>
                    <ul className="texto1 mx-3">
                        <li>Evaluar la percepci칩n de los usuarios.</li>
                        <li>Determinar las emociones que experimentan los usuarios.</li>
                        <li>Analizar la comprensi칩n del contenido mostrado en las pantallas y evaluar si la cantidad de informaci칩n es adecuada y comprensible.</li>
                        <li>Identificar en que contextos los usuarios usan el servicio</li>
                        <li>Evaluar su facilidad de uso y sus posibles dificultades de navegaci칩n en el flujo.</li>
                        <li>Analizar la satisfacci칩n de los usuarios con cada pantalla presentada.</li>
                        
                    </ul>
                    
                    <div className="row my-3">                   
                    <h2 className="titulo6">Metodolog칤a</h2>
                    <p className="texto1">Se realiz칩 una prueba de usabilidad virtual en base a un protocolo preparado con las preguntas elaboradas seg칰n los objetivos propuestos, para ello se precis칩 de 5 personas usuarias entre 18 a 25 a침os que utilicen la opci칩n de recarga por medio de una app de banco. Posteriormente se consolid칩 la informaci칩n a trav칠s de material audiovisual y escrito, por medio de notas registradas acerca de las opiniones y quotes de los usuarios, lo que permiti칩 realizar el proceso de an치lisis.  </p>  
                    <img src={img6} alt="Disney3" className="img-fluid" width="300"/>
                    <p className="texto1"><small>Notas de las opiniones de los usuarios</small></p>
                    </div> 


                    <div className="row my-3 ">
                        
                           <div className="col-sm my-3">
                            <p className="texto1 ">  Comenzamos por explorar la aplicaci칩n de Airbnb, continuando por realizar una evaluaci칩n individual y otra grupal, ambas  con base a los par치metros de Heur칤sticas y leyes establecidas en el 치mbito de la usabilidad, lo que tambi칠n incluye el Dise침o Visual y la forma de comunicar ideas a trav칠s de los textos empleados en el flujo. 
Posteriormente se discutieron los hallazgos encontrados, para clasificarlos con base en la Escala de Severidad planteada por David Travis (2009). Este m칠todo permite identificar aquellas 치reas en las que se necesita poner especial atenci칩n, pues el impacto en el usuario es significativo. Finalmente se buscaron referentes de plataformas web que aplican las buenas pr치cticas que se proponen como soluci칩n a los puntos de mejora. </p>
                           </div> 
                           <div className="col-sm my-3 text-center">
                            <img src={img6} alt="Disney3" className="img-fluid" width="300"/>
                            <p className="texto1"><small>5 fases de evaluaci칩n</small> </p>
                           </div> 
                           <p className="texto1">Se identificaron 10 hallazgos de los cuales actontinuaci칩n se desglosa un punto de mejora y una buena pr치ctica para un mejor entendimiento.</p>                 
                         
                </div>      
                                          
                </div>

            </div>
       
            <div className="container">
                   <div className="row">
                    <h2 className="titulo6">Tarea re</h2>
                    <p className="texto1"> La plataforma de AirBnb cuenta con servicios 칰nicoos y destacables, sin embargo tambi칠n se encontraron 치reas de mejora entorno a las leyes de usabilidad y las heur칤sticas que podr침ian limitar la navegaci칩n de la plataforma por parte de los usuarios e incrementar la tas de abandono. </p> 
                      </div>
            </div>





            <div className="container my-3">
                <div className="row">
                    <div className="col-sm my-3">
                        <Link to="/">   <button className="btn btn-primary"> Volver al men칰</button></Link>
                    </div>
                    <div className="col-sm my-3">
                        <Link to="/UX/UI">   <button className="btn btn-primary"> Siguiente</button></Link>
                       
                    </div>
                </div>
            </div>
             
          
            
        </div>
    );

}
